import React from 'react';

import Menu from '../menu/Menu';
import Slider from './slider/Slider';
import Servicios from './servicios/Servicios';
import Footer from '../footer/Footer';
import BrandSlider from '../sliderbrand/BrandSlider';
import CategorySlider from '../category/Category';


class Home extends React.Component {

	render() {

		return(

			<>

			<Menu />

			<main role="main" className="flex-shrink-0 mt-5">
			
			<Slider />
			<div className="mx-auto" style="width: 200px;">
			<h1 className="h1">Datos de salud</h1>
					<h1 className="h1 display-4">Datos de salud</h1>
			</div>
				<div className="container abs-center">
					
				</div>
				
				
				
				<CategorySlider></CategorySlider>

		        <div className="container">
		  	  		
		  	  		<Servicios />

		  	  		<hr className="featurette-divider" />

		        </div>

				<div className="container">
					
					<BrandSlider></BrandSlider>
					</div>

	  		</main>

	  		<Footer />

	  		</>

		)

	}

}

export default Home;
